using DeltaXDemo.Models;
using Microsoft.EntityFrameworkCore;
using Microsoft.Extensions.Configuration;
using System;
using System.Collections.Generic;
using System.Linq;
using System.Threading.Tasks;

namespace DeltaXDemo.DataAccess
{
    public class DeltaXSqlContext:DbContext
    {
        IConfiguration _configuration;
        public DeltaXSqlContext(IConfiguration configuration)
        {
            _configuration = configuration;
        }

        protected override void OnConfiguring(DbContextOptionsBuilder optionsBuilder)
        {
            optionsBuilder.UseSqlServer(_configuration.GetConnectionString("ConnStr"), providerOptions => providerOptions.CommandTimeout(60));
        }

        public DbSet<Actor> Actors { get; set; }
        public DbSet<Producer> Producers { get; set; }
        public DbSet<Movie> Movies { get; set; }
        public DbSet<MovieActorMapping> MovieActorMappings { get; set; }

        internal void EnsureSeedData()
        {
            if (!this.Movies.Any() && !this.Producers.Any() && !this.Actors.Any())
            {
                var movie = new Movie
                {
                    Name = "The Matrix",
                    Plot = "A computer hacker learns from mysterious rebels about the true nature of his reality and his role in the war against its controllers.",
                    Producer = new Producer
                    {
                        Name = "Joel Silver",
                        DOB = Convert.ToDateTime("July 14, 1952"),
                        Bio = "Joel Silver (born July 14, 1952) is an American film producer, most well known for action films including the Lethal Weapon series, The Matrix trilogy, the first two Die Hard movies, and Predator. He is the owner of Silver Pictures and co-founder of Dark Castle Entertainment. He has been a rival to Michael Eisner, former CEO of The Walt Disney Company, since their days at Paramount Pictures.",
                        Sex = Sex.Male
                    },
                    Actors = new List<MovieActorMapping>
                    {
                        new MovieActorMapping{
                        Actor= new Actor{
                            Name="Keanu Reeves",
                            Sex=Sex.Male,
                            DOB=Convert.ToDateTime("September 2, 1964"),
                            Bio="Keanu Charles Reeves, whose first name means 'cool breeze over the mountains' in Hawaiian, was born September 2, 1964 in Beirut, Lebanon"
                        }
                        },
                        new MovieActorMapping{
                        Actor=new Actor
                        {
                            Name="Carrie-Anne Moss",
                            Sex=Sex.Female,
                            DOB=Convert.ToDateTime("August 21, 1967"),
                            Bio="Carrie-Anne Moss was born on August 21, 1967, in Vancouver, British Columbia, the youngest of two children of Barbara and Melvyn Moss."
                        }
                        }
                    },
                    ReleaseYear = 1999,
                    Poster = System.Convert.FromBase64String("")
                };
                this.Movies.Add(movie);
                this.SaveChanges();
            }
        }
    }
}
